import React, { useEffect, useState } from 'react'
import Cookies from 'js-cookie';

export const Logout = () => {

    const logout = () => {
        Cookies.set('loggedIn', '0');
    }

    const [time, setTime] = useState(5);

    useEffect(() => {
        logout();
        setTimeout(() => {
            window.location = "/"
        }, 3000)
        setTimeout(() => {
            setTime(time - 1)
        }, 1000)
    }, [time])

    return (
        <div className="container">
            <h1> Redirecting you to home page in {time} seconds</h1>
        </div>
    )
}
